import React, { useEffect, useState } from 'react';
import axios from 'axios';
import swal from 'sweetalert';

function AddProduct() {

    const [productInput, setProduct] = useState({
        name: '',
        description: '',
        active: '',
        errors: [],
    });
    
    const handleInput = (e) => {
        e.persist();
        setProduct({...productInput, [e.target.name]: e.target.value})
    }
    
    const addProduct = (e) => {
        e.preventDefault();
        
        const data = {
            name: productInput.name,
            description: productInput.description,
            active: productInput.active,
        }
    
        axios.post(`/api/add-product`, data).then(res => {
            if (res.data.status === 200) {
                swal("Success", res.data.message, "success");
                document.getElementById("add_product").reset();
            } else if (res.data.status === 400) {
                setProduct({...productInput, errors:res.data.errors});
            }
        });
    }

    return (
        <div className='container-fluid px-4'>
            <div className="card mt-4">
                <div className="card-header">
                    <h4>Dodaj novi proizvod</h4>
                </div>
                <div className="card-body">
                    <form onSubmit={addProduct} id="add_product">
                        <ul className="nav nav-tabs" id="myTab" role="tablist">
                        <li className="nav-item" role="presentation">
                            <button className="nav-link active" id="home-tab" data-bs-toggle="tab" data-bs-target="#home-tab-pane" type="button" role="tab" aria-controls="home-tab-pane" aria-selected="true">Home</button>
                        </li>
                        <li className="nav-item" role="presentation">
                            <button className="nav-link" id="profile-tab" data-bs-toggle="tab" data-bs-target="#docs-tab-pane" type="button" role="tab" aria-controls="docs-tab-pane" aria-selected="false">SEO Tags</button>
                        </li>
                        </ul>
                        <div className="tab-content" id="myTabContent">
                            <div className="tab-pane card-body border fade show active" id="home-tab-pane" role="tabpanel" aria-labelledby="home-tab" tabIndex="0">
                                <div className="form-group mb-3">
                                    <label>Izaberi kategoriju</label>
                                    <select name="category_id" className="form-control">
                                        <option>Izaberi kategoriju</option>
                                    </select>
                                </div>
                                <div className="form-group mb-3">
                                    <label>Naziv</label>
                                    <input type="text" name="name" onChange={handleInput} value={productInput.name} className="form-control" />
                                </div>
                                <div className="form-group mb-3">
                                    <label>Opis</label>
                                    <textarea name="description" onChange={handleInput} value={productInput.description} className="form-control"></textarea>               
                                </div>
                                <div className="form-group mb-3">
                                    <label>Količina</label>
                                    <input type="text" name="quantity" onChange={handleInput} value={productInput.quantity}/>               
                                </div>
                                <div className="form-group mb-3">
                                    <label>Aktivno</label>
                                    <input type="checkbox" name="active" onChange={handleInput} value={productInput.active}/>               
                                </div>
                            </div>
                            <div className="tab-pane card-body border fade show active" id="docs-tab-pane" role="tabpanel" aria-labelledby="docs-tab" tabIndex="0">
                                <div className="form-group mb-3">
                                    <label>Fotografija</label>
                                    <input type="file" name="photo" onChange={handleInput} value={productInput.photo}/>               
                                </div>
                            </div>
                        </div>

                        <button type="submit" className="btn btn-primary px-4 float-end">Spremi</button>
                    </form>
                </div>
            </div>
        </div>
    )
}

export default AddProduct;
